import SidebarMenu from 'react-bootstrap-sidebar-menu'
import { faNewspaper } from '@fortawesome/fontawesome-free-regular';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Sidebar(props){
    return(
         <>
           <SidebarMenu>
            <SidebarMenu.Header>
              <SidebarMenu.Brand style={{margin:"10px"}}>
                 <FontAwesomeIcon icon={faNewspaper} color='red' style={{height:"25px", width:"25px"}} />
              </SidebarMenu.Brand>
                 <SidebarMenu.Text style={{marginLeft:"5px", padding:"5px", fontWeight:"bolder"}}>News Bulation</SidebarMenu.Text>
              <SidebarMenu.Toggle/>
            </SidebarMenu.Header>
           </SidebarMenu>
         </>
    );
}

export default Sidebar;
